function StudentList(){}StudentList.prototype.listenEditEvent=function(){var a=$(".submit-btn"),i=$("#level-input");a.click(function(t){t.preventDefault();var n=a.data("student-id"),e=i.val();acajax.post({url:"/student/student_list/",data:{student_id:n,level_id:e},success:function(t){window.location.reload()}})})},StudentList.prototype.listenDelEvent=function(){$(".del-btn").click(function(t){t.preventDefault();var n=$(this).attr("data-student-id"),e=$(this).attr("data-student-name");acalert.alertConfirm({msg:"确定要开除"+e+"吗?",confirmCallback:function(){acajax.post({url:"/student/del_student_school/",data:{student_id:n},success:function(t){acalert.alertSuccess({title:"欧耶~",msg:"恭喜你毁了"+e+"的未来！TA辍学了！",confirmCallback:function(){window.location.reload()}})}})}})})},StudentList.prototype.run=function(){this.listenDelEvent(),this.listenEditEvent()},$(function(){(new StudentList).run(),$("#level-modal").on("show.bs.modal",function(t){var n=$(t.relatedTarget),e=$(".submit-btn"),a=n.data("student-superpower"),i=n.data("student-id");$(this).find('option[value="'+a+'"]').attr("selected",!0),e.attr("data-student-id",i)})});